import React from 'react';
import Joke from './Joke';
import JokesData from 'JokesData.js';

function App(){
  const newArray=JokesData.map((joke)=>{
    return(
        <Joke question={joke.question}
              punchLine={joke.punchLine}
        />
    );
  }); 

  return (
  <div>  
     {newArray}
  </div>
  );
}
export default App;









